                    orca.perfTimeEnd("Measure: " + widgetMeasure + ", Type: " + widgetType + ", ID: " + widgetId + widgetSubmeasureStr, null, raptrId, null, "ONE", "userFriendly", {widgetTitle: widgetTitle, keyValueData: keyValueData});
